import logo from './logo.svg';
import './App.css';
import Home from './pages/Home'
import { BrowserRouter as Router, Route, Routes, Link, Switch} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path='/' component={Home} />
          <Route path='/home' component=<Home/> />
          </Routes>
      </Router> 
    </div>
  );
}

export default App;
